description:
A monkey king who learns the secrets of magic goes on a spree and causes no end of aggravation for the gods, who finally imprison him. In order to make up for all the trouble he's caused, he is sent on a mission to accompany a prince who is the son of the gods on a journey through a land filled with dangers, monsters, cannibals and demons. Written  

